	add("skivvies", "{\"term\":\"skivvies\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Underwear, particularly men′s underwear\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, w:Joe Joe Meno, \u0027w:How the Hula Girl How the Hula Girl Sings\u0027, 2005, %22skivvies%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dBoQb4o32gQ\u0026amp;sig\u003dB2-pXv3vi5_dBdy6aUj7g9ppkN8\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dRspOUOXtG6WImQWH8YCACQ\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"%22skivvies%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 165\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Then she pulled his pants down around his knees. He had a pair of old gray-and-white tight \u0027\u0027skivvies\u0027\u0027 on. They were worn and threadbare and tight around his groin\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Chuck Frazier, \u0027Decades\u0027, iUniverse, %22skivvies%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dGqTNMVwDb2\u0026amp;sig\u003dGJRJJfxzjqmOt88zYlQoTumVRV0\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dRspOUOXtG6WImQWH8YCACQ\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"%22skivvies%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 89\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"“I brought some jeans, a sweater, a heavy shirt, some thermal socks and some \u0027\u0027skivvies\u0027\u0027.” He replied\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"“\u0027\u0027Skivvies?\u0027\u0027” A questioning look wrinkled her forehead\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"“Undershirts and underpants.” He explained\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, James R. Kelly, \u0027Casting Alpha: Amtracs in Vietnam\u0027, %22skivvies%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dw3a1nyKD7F\u0026amp;sig\u003dMp5Ok6E2cla4v4VBUm-HNol_ZuM\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dRspOUOXtG6WImQWH8YCACQ\u0026amp;redir_esc\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"%22skivvies%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 86\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Everyone in 2nd platoon had two pairs of boots, two pairs of utilities and several pair of \u0027\u0027skivvies\u0027\u0027, which served no purpose in Nam. No one wore \u0027\u0027skivvies\u0027\u0027 because of the intense heat and it took only one case of heat rash, affectionately named “crotch rot,” to impress on us that \u0027\u0027skivvies\u0027\u0027 were better suited as rags to clean weapons and tools\", \"priority\":12}]}, \"synonyms\":{}}");

